$(function() {
var header = $("#getInTouch");
	$(window).scroll(function() {
	var scroll = $(window).scrollTop();
	if (scroll >= 300)  {
	header.addClass("navbar1");
	} else {
	header.removeClass("navbar1");
	}
});
var formBox = $("#headerContainer");
	$(window).scroll(function() {
	var scroll = $(window).scrollTop();
	if (scroll >= 300) {
	formBox.addClass("slimheader");
	} else {
	formBox.removeClass("slimheader");
	}
});
var formHeading = $("#formHeader");
	$(window).scroll(function() {
	var scroll = $(window).scrollTop();
	if (scroll >= 300) {
	formHeading.addClass("noHeading");
	} else {
	formHeading.removeClass("noHeading");
	}
});
});

